import React from 'react';
import Header from './Header';

function Login() {
    return(
        <div>
            <Header>
                <a href="/sign-up" className="header__link">Регистрация</a>
            </Header>
            <form name="main-form" action="#" className="main-form" noValidate>
                <h2 className="main-form__title">Вход</h2>
                <input type="text" name="email" className="main-form__input" placeholder="Email"/>
                <input type="password" name="password" className="main-form__input" placeholder="Пароль"/>
                <button type="submit" name="submit" className="main-form__button">Войти</button>
            </form>
        </div>
        );
}

export default Login;
